//class AnimationData : public DrawData
AnimationData.prototype = new DrawData();
AnimationData.prototype.constructor = AnimationData;
AnimationData.uber = DrawData.prototype;
function AnimationData(svg_list, svg_type, speed, box) {
	//Liner_Vector array
	this.svg_list = svg_list;
	this.svg_type = svg_type;
	this.speed = speed;
	this.now_frame = 0;
	this.now_playing = null; 
	//////////////////////////
	this.box = box;
	this.obj = document.createElementNS(this.xmlns,'g');
	this.box.appendChild(this.obj);
}
AnimationData.prototype.draw = function () {
	this.obj.innerHTML = this.svg_list[this.now_frame];
}
AnimationData.prototype.play = function (times) {
	
	this.play_times = times;
	now_run.can_run = false;
	
	this.now_playing = setInterval( (function(self) {         //Self-executing func which takes 'this' as self
         return function() {   //Return a function in the context of 'self'
			if(self.now_frame==self.svg_list.length-1)self.play_times--
             self.next_frame(); //Thing you wanted to run as non-window 'this'
			 self.draw();
			if(self.play_times<=0){
				clearInterval(self.now_playing);
				now_run.can_run = true;
			}
         }
     })(this), this.speed);
}
AnimationData.prototype.next_frame = function () {
	this.now_frame++;
	if(this.now_frame >= this.svg_list.length){
		this.now_frame = 0;
	}
}
//event
function FrameChanged() {
	//console.log(grander.ready);
	try{
		if(grander.ready){
			clear_buffer();
			var canvas = document.getElementById('canvas');
			canvas.width = grander.width;
			canvas.height = grander.height;
			var svg_dom = document.getElementById('draw_frame').innerHTML;
			svg_dom = "<svg id=\"draw_frame\" width=\"" + grander.width + "px\" height=\"" + grander.height + "px\"  viewBox=\"0 0 120 120\"><rect fill=\"#FFFFFF\" x=\"0\" y=\"0\" width=\"" + grander.width + "px\" height=\"" + grander.height + "px\"/>" + svg_dom + "</svg>";
			//console.log(svg_dom);
			canvg(canvas, svg_dom);
			var context = canvas.getContext('2d');
			grander.encoder.addFrame(context);
		}
	}
	catch(ex){
		
	}
}
