gencoder.prototype.init = function (width_, height_, speed_) {
	this.encoder = new GIFEncoder();
	this.encoder.setRepeat(0); //auto-loop
	this.encoder.setDelay(speed_);
	this.width = width_;
	this.height = height_;
	this.encoder.setSize(width_,height_);
	this.encoder.start();
	this.ready = true;
}
function clear_buffer(){
	document.getElementById('draw_buffer').innerHTML = "<canvas style=\"background-color: rgba(255, 255, 255, 0)\" id=\"canvas\" width=\"" + grander.width + "\" height=\"" + grander.height + "px\"></canvas>";
}
